export default {
  name: 'ResultShow',
  props: {
    page: {
      type: String,
      default: 'betrecord' // 下注记录 会员

    },
    gameTypeId: {
      type: Number,
      default: 2001
    },
    result: {
      type: String,
      default: ''
    },
    judgeResult: {
      type: String,
      default: ''
    }
  },
  data: function data() {
    return {};
  },
  computed: {
    results: function results() {
      if (this.gameTypeId === 2012 && this.page === 'betrecord') {
        return this.result.split(':');
      }

      if (this.gameTypeId === 2010 || this.gameTypeId === 2009 || this.gameTypeId === 2011) {
        return this.result.replace(/\(/g, ' ').split(')');
      } else {
        return this.result.split(' ');
      }
    },
    judgeResults: function judgeResults() {
      var splitSymbol;

      if (this.gameTypeId === 2008 || this.gameTypeId === 2012 && this.page !== 'betrecord') {
        splitSymbol = ':';
      } else {
        splitSymbol = ';';
      }

      return this.judgeResult.split(splitSymbol);
    },
    // 百家乐特殊处理开牌顺序
    Baccarats: function Baccarats() {
      if (this.judgeResults[1]) {
        var arr = this.judgeResults[1].split(':') || [];

        if (arr.length > 2) {
          var temp = arr[0];
          arr[0] = arr[2];
          arr[2] = temp;
        }

        return arr;
      }

      return [];
    }
  },
  methods: {
    getPokerImage: function getPokerImage(value) {
      if (value.length > 5) return;
      return require("@/assets/result_images/poker".concat(value, ".png"));
    },
    getScImage: function getScImage(value) {
      return require("@/assets/result_images/sic_bo_zhong_sz".concat(value, ".png"));
    }
  }
};
